import React, { useEffect, useState } from 'react';

const TMDBPage = () => {
  const [movies, setMovies] = useState([]);
  const API_KEY = 'YOUR_TMDB_API_KEY'; // Replace this with your actual TMDB API Key

  useEffect(() => {
    fetch(`https://api.themoviedb.org/3/movie/popular?api_key=${API_KEY}`)
      .then(res => res.json())
      .then(data => {
        setMovies(data.results);
      })
      .catch(err => console.error('TMDB API fetch error:', err));
  }, []);

  return (
    <div>
      <h2>Popular Movies (TMDB)</h2>
      <div style={{ display: 'flex', flexWrap: 'wrap' }}>
        {movies.map(movie => (
          <div key={movie.id} style={{ margin: '10px', width: '200px' }}>
            <img
              src={`https://image.tmdb.org/t/p/w200${movie.poster_path}`}
              alt={movie.title}
              style={{ width: '100%' }}
            />
            <p>{movie.title}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default TMDBPage;
